import React from "react";

const Profile = () => {
  const user = {
    name: "Devika S",
    email: "devika@example.com",
    role: "AI Engineer",
    bio: "Passionate about AI, Big Data, and Full-Stack Development.",
    profilePic: "https://via.placeholder.com/150", // replace with real user image
  };

  return (
    <div className="p-6">
      <div className="bg-white shadow-lg rounded-2xl p-6 flex flex-col items-center max-w-md mx-auto">
        <img
          src={user.profilePic}
          alt="Profile"
          className="w-32 h-32 rounded-full border-4 border-green-600 shadow-md"
        />
        <h2 className="mt-4 text-2xl font-bold text-gray-800">{user.name}</h2>
        <p className="text-gray-600">{user.role}</p>
        <p className="text-gray-500 mt-2 text-center">{user.bio}</p>

        <div className="mt-4 w-full">
          <div className="flex justify-between p-3 border-b">
            <span className="font-semibold">Email</span>
            <span>{user.email}</span>
          </div>
          <div className="flex justify-between p-3 border-b">
            <span className="font-semibold">Role</span>
            <span>{user.role}</span>
          </div>
        </div>

        <button className="mt-6 bg-green-600 hover:bg-green-700 text-white px-6 py-2 rounded-lg shadow">
          Edit Profile
        </button>
      </div>
    </div>
  );
};

export default Profile;
